import TryGlassApp_Items from "./TryGlassApp_Items";

export default class TryGlassesApp_Footer extends Component {
  render() {
    return (
      <div className="mx-10">
        <div className="row">
          {this.props.glassesArr.map((item) => {
            return <TryGlassApp_Items glassesItem={item} />;
          })}
        </div>
      </div>
    );
  }
}
